  false,\n\t\"url\": null,\n\t\"notes\": \"The USGS Salton Sea project encompasses
  a 5-kilometer buffer around the Salton Sea, California. Dewberry classified LiDAR
  for a project boundary that touches 623 tiles (1500 m x 1500 m). Dewberry also created
  tiled DEMs with a hydro-flattened lake surface. The original horizontal spatial
  reference system for the USGS Salton Sea project was NAD83, UTM Zone 11N, meters.
  Two sets of LAS are delivered that have different vertical reference systems. These
  include: 1. Ellipsoidal, meters and 2. NAVD88, meters. OCM converted all files to
  ellipsoidal (geoid09) and horizontal geographic projections to meet OCM schema.\",\n\t\"license_title\":
